{"description":"I’d like to vouch for Nat, the OG of Pudgy Penguins Thailand and a true community builder at heart. He’s been a welcoming force in the Thai Web3 scene — always the first to reach out, help newcomers, and make sure people feel at home. If you’re ever in Thailand, hitting him up is a must.

Nat is all about education and empowerment. He’s constantly helping others level up — whether it’s through sharing knowledge, supporting builders, or encouraging growth in the space. A real pillar in the local community.

No question — Nat is the GOAT of Pudgy and Abstract Thailand."}

{"description":"Aliru est très présent au sein de l'ecosystème Abstract, il est un Gigachad actif, souvent là pour aider la communauté. 

